var base = require("../../../popup/base/base.js");
var util = require("../../../../utils/util.js");
global.wxComponent({
  mixins: [base],
  /**
   * 组件的属性列表
   */
  properties: {
  },

  /**
   * 组件的初始数据
   */
  data: {

  },

  /**
   * 组件的方法列表
   */
  methods: {
    share(){
      this.triggerEvent('shareMoments')
      this.bindClose()
    },
    downloadPoster(e){
      let isMultiple = !!e.currentTarget.dataset.isMultiple
      wx.showLoading({
        title: '生成中',
      })
      let posterImage = 'data:image/jpeg;base64,'
      this.setData({
        showPoster:true,
        posterImage: [posterImage]
      })
      wx.hideLoading()
      this.bindClose()
    },

  }
})
